The national anthem of Saint Vincent and the Grenadines is called "Oh Land of Beauty!". It was written in 1979 by Phyllis Joyce McClean Punnett. The anthem was adopted on October 27, 1979, and the lyrics pay homage to the beauty of the country's landscape, and its people. The anthem is as follows:
Refrain:
Oh Land of beauty!
Our pride and joy!
It's sweet rejoicing;
Sweet jubilations!
Verse 1:
From the mighty mountains; 
Where teeming valleys lie;
Blue waters glisten;
Gently lapsing sea!
Verse 2:
Lush green forests;
Fertile pastures galore!
Our landscapes changing;
Throughout every shore! 
Verse 3:
Each village, each town;
Broad landscapes unfold;
Our paths enlightened;
By each precious soul!
Verse 4:
From yonder hill tops;
To our loamy roads;
Garnished with kindness;
Through truth and devotion!
Verse 5:
So hail this haven!
This Glorious Place;
Our folks praising;
Its rightful praise!
